Condition : 14 - Prior to the occupation of the development hereby permitted, a Travel Plan shall be submitted to and approved in writing by the Local Planning Authority. The Plan shall follow the current 'Travel Plan Development Control Guidance' issued by TfL and shall include:
  (i) Targets for sustainable travel arrangements;
  (ii) Effective measures for the on-going monitoring of the Plan;
  (iii) A commitment to delivering the Plan objectives for a period of at least 5 years from the first occupation of the development;
  (iv) Effective mechanisms to achieve the objectives of the Plan by both present and future occupiers of the development.
The development shall be implemented only on accordance with the approved Travel Plan.

Condition : 24 - The development shall be carried out in accordance with the following recommendations set out at Section 4 of the submitted Preliminary Ecological Appraisal dated October 2018:

� A buffer strip of native thorny planting to be put in place along the northern boundary. This will help
mitigate impacts on the brook adjacent to site, and enhance the site for bats, birds, and mammals;
� Site vegetation clearance to be undertaken in September to exclude the bird nesting season (March to August inclusive) and hedgehog hibernation period (October to March) or immediately after an ecologist has confirmed the absence of nesting birds/hedgehogs;
� Bat sensitive lighting to be used along the northern boundary of the site to mitigate for impacts upon boundary habitats and trees that are potentially of use to local bat populations;
� Precautionary construction techniques sensitive to hedgehog/otter/water vole to be employed;
� Pollution prevention control to be put in place during the construction phase.

Condition : 43 - The Dust Management Plan required by condition: 
"	May be integrated within a wider Construction Environmental Management Plan (CEMP);
"	Must mitigate negative impact on air quality and receptors in the vicinity;
"	Must detail the measures that will be taken to reduce the impacts on air quality during all construction phases (demolition, construction, Earthworks, Trackout)
"	Must include maintenance schedule of the dust mitigation measures;
"	Must undertake to carry out air quality monitoring before, during and after demolition and construction works (at least a month prior to commencement of any works on site). Parameters to be monitored, duration, locations and monitoring techniques must be approved in writing by Wandsworth Council prior to commencement of monitoring.
"	Shall be in accordance with "The Control of Dust and Emissions during Construction and Demolition", Mayor of London SPG 2014.
